export const Home = () => {
  return (
    <>
      <div className="homePage">
        <div className="fromWrapper">
            <h2 className="logo">real-time code editor</h2>
            <h4 className="lable">Enter invitation room id</h4>
            <div className="ints_here">
                <input type="text" placeholder="room id" className="input_box" />
                <input type="text" placeholder="user name" className="input_box" />
                <button className="btn btn_1">Join</button>

                <span className="createInfo">
                    it you don't have an invitation then create &nbsp;
                    <a href="/" className="createNew">new room</a>
                </span>
            </div>
        </div>
      </div>
      <footer>
          h4.foo
      </footer>
    </>
  );
};
